- input: "TEXT\x1CC00413716\x1CX0\x1C\x1CF3XA\x1CTo Whom It May Concern: This amendment
    is in response to the letter dated 12/15/10 for Committee ID: C00413716 concerning
    the October Monthly Report of New York Jobs PAC.     Upon further review of our
    reports, it has come to our attention that there were a number of clerical errors
    made in the disclosure of certain disbursements seemingly impermissible for the
    2010 Primary election.  These disbursements when imported into our filing software
    defaulted to an election code coinciding with the date of the Primary election
    in the home state of the PAC, rather than the state to which these funds were
    disbursed. This report reflects the proper election period of the disbursements.
    \    Further, cross referencing these disbursements with the October Quarterly
    reports of CITIZENS TO ELECT RICK LARSEN, COMMITTEE TO RE-ELECT LORETTA SANCHEZ
    and GIFFORDS FOR CONGRESS will reveal the correct election period disclosure for
    each disbursement. \n"
